import React from "react";
import "./Experience.css";

const Experience = () => {
  return (
    <div className="Experience">
      <div class="alt-vtl">
        <div class="alt-event">
          <p class="date">Aug. 2022 - Present</p>
          <p class="pos">Accenture: Technology Architecture Delivery Analyst</p>
          <p class="txt">• Executed system integration testing (SIT) and user acceptance testing (UAT) in Panaya and Oracle CPQ
          • Contributed to technical documentation and the development of incoming technologies
          • Trained in agile methodologies, data analysis, and devOps processes</p>
        </div>
        <div class="alt-event right">
          <p class="date">Summer 2021</p>
          <p class="pos">Condo Roccia Koptiw LLP: Summer Associate</p>
        </div>
        <div class="alt-event">
          <p class="date">Aug. 2019 - May 2020</p>
          <p class="pos">Purdue University: Engineering Undergraduate Teaching Assistant</p>
        </div>
      </div>
    </div>
  );
};
export default Experience;
